{'title': 'Sat-B - African Gal (Official Video)', 'description': "Kora Entertainment present AFRICAN GAL, East Africa's Artist Sat-B drops her latest single African Gal. This enchanting love song was produced by Rwandan producer Pacento. this song is a feel good guaranteed anthem. Accompanied by visuals directed by Meddie Menz from Uganda,the video was shooted in Kampala and Kigali, this sexy love song is another testimony of the increase in quality productions from Burundi and a definite new fan favorite for Sat-B fans. 
Sat-B considered influential among his fans, and is said to be the most loved Burundian artist at the moment. LEVEL UP with Vusi Nova https://www.youtube.com/watch?v=PH0wg4e91Ak 

#Africori #TheBestInAfricanMusic #BestOfAfrica"}

